[package]
name = "web-sys"
version = "0.3.27"
authors = ["The wasm-bindgen Developers"]
readme = "./README.md"
homepage = "https://rustwasm.github.io/wasm-bindgen/web-sys/index.html"
documentation = "https://rustwasm.github.io/wasm-bindgen/api/web_sys/"
repository = "https://github.com/rustwasm/wasm-bindgen/tree/master/crates/web-sys"
description = """
Bindings for all Web APIs, a procedurally generated crate from WebIDL
"""
license = "MIT/Apache-2.0"
edition = "2018"

[package.metadata.docs.rs]
all-features = true

[lib]
doctest = false
test = false

[build-dependencies]
env_logger = { version = "0.6.0", optional = true }
failure = "0.1.2"
wasm-bindgen-webidl = { path = "../webidl", version = "=0.2.50" }
sourcefile = "0.1"

[dependencies]
wasm-bindgen = { path = "../..", version = "0.2.50" }
js-sys = { path = '../js-sys', version = '0.3.27' }

[target.'cfg(target_arch = "wasm32")'.dev-dependencies]
wasm-bindgen-test = { path = '../test', version = '0.3.0' }
wasm-bindgen-futures = { path = '../futures', version = '0.4.0' }

